import React, { Component } from "react";

import UserService from "../services/user.service";
import Rankchart from './Rankchart'

export default class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response && error.response.data) ||
            error.message ||
            error.toString()
        });
      }
    );
  }

  render() {
    return ( <>

      <div className = 'cent' style={{margin : '20px', width : '100%'}}>

<div style={{ display: 'flex', justifyContent: 'center' }}>
<table className = 'cent' >
  <tbody>
<tr>
      <td colSpan="4" style={{ textAlign: 'left' }}>
        <p>당신이 좋아할만한 믹스테잎</p>
      </td>
</tr>    
  <tr style={{ justifyContent: 'center' }} >
    <td className = 'tdSize'><img src="https://cdnimg.melon.co.kr/cm2/album/images/112/82/857/11282857_20230710164942_500.jpg?5dd5e9f9599a05bee806b9056336326f/melon/resize/282/quality/80/optimize" alt="Image 1" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="https://cdnimg.melon.co.kr/cm2/album/images/112/62/317/11262317_20230710172603_500.jpg?80afd72eae9bad3ce52aa40ee434409c/melon/resize/282/quality/80/optimize" alt="Image 2" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="https://i.scdn.co/image/ab67616d0000b273896d58b11f283276b00a74fd" alt="Image 3" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image4.jpg" alt="Image 4" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
  </tr>
  <tr style={{ justifyContent: 'center' }} >
    <td className = 'tdSize'><img src="image5.jpg" alt="Image 5" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image6.jpg" alt="Image 6" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image7.jpg" alt="Image 7" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image8.jpg" alt="Image 8" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
  </tr>
  </tbody>
</table>  
</div>
<br/>
<br/>

<div style={{ display: 'flex', justifyContent: 'center' }}>
<table className = 'cent'>
<tbody>
<tr>
      <td colSpan="4" style={{ textAlign: 'left' }}>
        <p>'데이식스'를 좋아하는 당신에게</p>
      </td>
</tr>  
<tr style={{ justifyContent: 'center' }} >
    <td className = 'tdSize'><img src="image5.jpg" alt="Image 5" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image6.jpg" alt="Image 6" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image7.jpg" alt="Image 7" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
    <td className = 'tdSize'><img src="image8.jpg" alt="Image 8" style={{maxWidth : '180px',  maxHeight : '180px' }} /></td>
</tr>  
</tbody>
</table>  
</div>

<br/>
<br/>

<Rankchart />



</div>

      <div className="container">
        <header className="jumbotron">
          <h3>{this.state.content}</h3>
        </header>
      </div>
      </>
    );
  }
}
